(2, 'hello', '<h1><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">&ndash; PDF</span></h1>\r\n<div>\r\n<div id=\"text-7\">\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n<div>\r\n<div>\r\n<div id=\"text-6\">\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n<figure></figure>\r\n</div>\r\n<div>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Everytime an article is written by someone using a computer, there is a good chance that such article was written using a computer program, in most cases, Microsoft Word. But there are many other writing programs out there such as LibreOffice Writer, Scribus, FocusWriter, Evernote, et cetera. All these writing softwares make use of document templates for the writer to type in the words. The most common template is a blank template. But what exactly is a template?</span></p>\r\n<div>\r\n<div id=\"text-2\">\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n<h2><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Yosemite Purple Template</span></h2>\r\n<div>\r\n<div><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\"><strong>resumecompanion.com</strong></span></div>\r\n<div>\r\n<div><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Details</span></div>\r\n<div><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">File Format</span></div>\r\n<ul style=\"list-style-type: none;\">\r\n<li style=\"list-style-type: none; color: rgb(236, 240, 241);\"><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">PDF</span></li>\r\n</ul>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Size: 15 KB</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\"><a style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\" href=\"https://images.examples.com/wp-content/uploads/2018/07/Yosemite-purple-template-example.docx.zip\" target=\"_blank\" rel=\"noopener\">Download</a></span></p>\r\n</div>\r\n</div>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Template, the origin of the word before it was a Word</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Template as pattern upon which other things are made into. Examples:</span></p>\r\n<ul style=\"list-style-type: none;\">\r\n<li style=\"list-style-type: none; color: rgb(236, 240, 241);\"><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">His face was used as a template for the rest of the male models.</span></li>\r\n<li style=\"list-style-type: none; color: rgb(236, 240, 241);\"><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Her walking pattern was a template for all her daughters.</span></li>\r\n<li style=\"list-style-type: none; color: rgb(236, 240, 241);\"><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">The school&rsquo;s meeting procedure was a template for the young boys club.</span></li>\r\n</ul>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">And like the meaning of the word template in which it can be used as patterns, template as word document can vary in designs, patterns as well. It can be of any category.</span></p>\r\n<h2><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Yosemite Aquatic Template</span></h2>\r\n<div>\r\n<div><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\"><strong>resumecompanion.com</strong></span></div>\r\n<div>\r\n<div><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Details</span></div>\r\n<div><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">File Format</span></div>\r\n<ul style=\"list-style-type: none;\">\r\n<li style=\"list-style-type: none; color: rgb(236, 240, 241);\"><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">PDF</span></li>\r\n</ul>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Size: 15 KB</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\"><a style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\" href=\"https://images.examples.com/wp-content/uploads/2018/07/Yosemite-aquatic-blue-template-example.docx.zip\" target=\"_blank\" rel=\"noopener\">Download</a></span></p>\r\n</div>\r\n</div>\r\n<div>\r\n<div>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Here are some categories for a word document template.</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Resumes and cover letters</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">When one applies for a job, more or less, the first thing one does is to provide the company a resume, as well as a cover letter. The cover letter is much like any other letter from an applicant intending to apply for a job. But the resume can be very varied, from a simple one that only list the applicant&rsquo;s work experiences, to something very fancy, with tables and columns.</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Calendars</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">While it may not sound as something as a word document, a calender can actually be designed entirely from any word application program. And it is perhaps why there is such a need for a template. Usually, a calendar template is just a blank calender that looks like a table. And just by adding numbers to this table, one can have a calendar.</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Flyers</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">They are called flyers because they are supposed to fly. They fly because they are small scale documents used for giving small information. The format may be a bit different from the usual blank template, such that their paper size is smaller.</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Planners and trackers</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Oftentimes, you do not want to use a paragraph style of writing. That is the case when you want to jot schedules, to-do-lists in a bullet style listing.</span></p>\r\n<p>&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\"><strong>template.net</strong></span></div>\r\n<div>\r\n<div><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Details</span></div>\r\n<div><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">File Format</span></div>\r\n<ul style=\"list-style-type: none;\">\r\n<li style=\"list-style-type: none; color: rgb(236, 240, 241);\"><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">PDF</span></li>\r\n</ul>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Size: 4 KB</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\"><a style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\" href=\"https://images.examples.com/wp-content/uploads/2018/07/Table-of-Contents-template-example.doc.zip\" target=\"_blank\" rel=\"noopener\">Download</a></span></p>\r\n</div>\r\n</div>\r\n<h2>&nbsp;</h2>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Newsletters</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Here is a template designed for you to arrange your text as well as photos. But this is not an ordinary template, newletter templates are one of the most complicated format for observing document layouts. But with the use of templates, writing newsletters is as easy as writing any form of document.</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Themes</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Some typing programs provide you with the use of themes. They are not oo far from any ordinary template, except that they come with color patterns and designs, borders, and fancy assigning of letter fonts. A theme may not necessarily be a template, rather it is something that gives a document a different look and design.</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Brochures</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">They look like those of flyers, except that they do not fly. They just broch&hellip; (kidding). Yes, actually a brochure can be a bit fancier, wider in size, than a flyer. Whereas a flyer has a specific size, a brochure can be of any size &ndash; sometimes even foldable.</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Papers and Reports</span></p>\r\n<p><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Papers or academic papers are designed for students usually required to be submitted in a classroom setting. A student perhaps may be asked to write something about the story of Romeo and Juliet by Shakespeare.</span></p>\r\n<p>&nbsp;</p>\r\n<h2><span style=\"background-color: rgb(52, 73, 94); color: rgb(236, 240, 241);\">Sample Cover Letter Example</span></h2>\r\n</div>', '2023-03-19 12:47:36', '2023-03-20 08:32:14'),
