he most complicated format for observing document layouts. But with the use of templates, writing newsletters is as easy as writing any form of document.</p>\r\n<p>Themes</p>\r\n<p>Some typing programs provide you with the use of themes. They are not oo far from any ordinary template, except that they come with color patterns and designs, borders, and fancy assigning of letter fonts. A theme may not necessarily be a template, rather it is something that gives a document a different look and design.</p>\r\n<p>Brochures</p>\r\n<p>They look like those of flyers, except that they do not fly. They just broch&hellip; (kidding). Yes, actually a brochure can be a bit fancier, wider in size, than a flyer. Whereas a flyer has a specific size, a brochure can be of any size &ndash; sometimes even foldable.</p>\r\n<p>Papers and Reports</p>\r\n<p>Papers or academic papers are designed for students usually required to be submitted in a classroom setting. A student perhaps may be asked to write something about the story of Romeo and Juliet by Shakespeare.</p>\r\n<p>&nbsp;</p>\r\n<h2>Sample Cover Letter Example</h2>\r\n</div>', '2023-03-19 12:51:09', '2023-03-19 13:25:17'),
(4, 'نظام الاسبوع الواحد', '<h1 style=\"text-align: right;\"><span style=\"text-decoration: underline; color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">نظام الاسبوع الواحد</span></h1>\r\n<h2 style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">أساسيات نجاح دايت المناسبات:</span></h2>\r\n<p style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">1- السكر ممنوع نهائيا.</span><br><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">2- تقليل السعرات الحرارية الداخلة للجسم إلى 1200 سعر بحد أقصى.</span><br><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">3- الابتعاد عن مصادر الدهون.</span><br><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">4- الالتزام بميعاد محدد لكل وجبة على مدار الأسبوع خاصة وجبة الإفطار.</span><br><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">5- تناول 12 كوبا من المياه خلال اليوم وقبل كل وجبة كوبين من المياه.</span><br><br></p>\r\n<h2 style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">خطة وجبات غذائية لا يتعدى محتواها 1200 سعر حراري في دايت المناسبات:</span></h2>\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n<h2 style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">وجبة الإفطار</span></h2>\r\n<p style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">- 2 &nbsp;قطعة خبز &ldquo;ثلثي رغيف كبير الحجم\"، بيضة مسلوقة مضاف إليها ملعقة كبيرة من زيت زيتون، وفلفل وجزر شرائح، ونصف كوب عصير تفاح أو تفاحة واحدة.</span><br><br></p>\r\n<h2 style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">وجبة خفيفة:</span></h2>\r\n<p style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">- كوب لبن خالي الدسم + قطعة فاكهة وحدة.</span><br><br></p>\r\n<h2 style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">وجبة الغداء:</span></h2>\r\n<p style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">- قطعة صدر دجاج متوسطة الحجم، ثلث كوب أرز، طبق سلطة &ldquo;حبتين خضار\"، نصف كوب لبن، نصف كوب عصير مانجو طبيعي.</span><br><br></p>\r\n<ul class=\"tox-checklist\" style=\"text-align: right;\">\r\n<li class=\"tox-checklist--checked\" style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">وجبة العشاء:</span></li>\r\n</ul>\r\n<p style=\"text-align: right;\"><span style=\"color: rgb(236, 240, 241); background-color: rgb(0, 0, 0);\">- قطعة كيك بدون كريم صغيرة الحجم، كوب شاي.</span></p>', '2023-03-20 08:34:37', '2023-03-20 08:47:59'),
(5, 'N1', '<p><span style=\"color: rgb(236, 240, 241); font-size: 18pt;\">BASIC DIET</span><br><strong><span style=\"color: rgb(236, 240, 241);\">BREAKFAST </span><span style=\"color: rgb(236, 240, 241);\">1</span></strong><br><span style=\"color: rgb(236, 240, 241);\">(Immediately upon waking)</span><br><span style=\"color: rgb(236, 240, 241);\">1 scoop protein powder</span><br><span style=\"color: rgb(236, 240, 241);\">1/2 medium cantaloupe</span></p>\r\n<p><strong><span style=\"color: rgb(236, 240, 241);\">BREAKFAST 2</span></strong><br><span style=\"color: rgb(236, 240, 241);\">(30-60 minutes after shake and cantaloupe)</span><br><span style=\"color: rgb(236, 240, 241);\">2 whole eggs</span><br><span style=\"color: rgb(236, 240, 241);\">egg whites</span><br><span style=\"color: rgb(236, 240, 241);\">2 1</span><br><span style=\"color: rgb(236, 240, 241);\">tbsp olive oil</span><br><span style=\"color: rgb(236, 240, 241);\">slice low-fat American cheese</span><br><span style=\"color: rgb(236, 240, 241);\">(scramble eggs cook in olive oil and add cheese)</span><br><span style=\"color: rgb(236, 240, 241);\">2 cups cooked oatmeal</span></p>\r\n<p><strong><span style=\"color: rgb(236, 240, 241);\">LATE MORNING SNACK</span></strong><br><span style=\"color: rgb(236, 240, 241);\">1 cup low-fat cottage cheese</span><br><span style=\"color: rgb(236, 240, 241);\">1 cup sliced pineapple</span><br><span style=\"color: rgb(236, 240, 241);\">(mix pineapple in cottage cheese)</span></p>\r\n<p><strong><span style=\"color: rgb(236, 240, 241);\">LUNCH</span></strong><strong><span style=\"color: rgb(236, 240, 241);\">&nbsp;</span></strong></p>\r\n<p><span style=\"color: rgb(236, 240, 241);\">1&nbsp;</span><span style=\"color: rgb(236, 240, 241);\">dose multivitamin</span><br><span style=\"color: rgb(236, 240, 241);\">1 can albacore tuna</span><br><span style=\"color: rgb(236, 240, 241);\">2 slices whole-wheat bread</span><br><span style=\"color: rgb(236, 240, 241);\">tbsp light mayonnaise</span><br><span style=\"color: rgb(236, 240, 241);\">1 large piece of fruit (apple, orange, banana, etc.)</span></p>\r\n<p><strong><span style=\"color: rgb(236, 240, 241);\">AFTERNOON SNACK</span></strong><br><span style=\"color: rgb(236, 240, 241);\">tbsp peanut butter</span><br><span style=\"color: rgb(236, 240, 241);\">1 1</span><br><span style=\"color: rgb(236, 240, 241);\">tbsp Jam</span><br><span style=\"color: rgb(236, 240, 241);\">2 slices whole-wheat bread</span><br><span style=\"color: rgb(236, 240, 241);\">(make PB sandwich)</span></p>\r\n<p><strong><span style=\"color: rgb(236, 240, 241);\">DINNER</span></strong><br><span style=\"color: rgb(236, 240, 241);\">230gm salmon</span><br><span style=\"color: rgb(236, 240, 241);\">1 cup chopped broccoli</span><br><span style=\"color: rgb(236, 240, 241);\">2 cups mixed green salad</span><br><span style=\"color: rgb(236, 240, 241);\">2 tbsp salad dressing (olive oil and vinegar)</span><br><span style=\"color: rgb(236, 240, 241);\">BEFORE BED SNACK</span><br><span style=\"color: rgb(236, 240, 241);\">1 dose ZMA</span><br><span style=\"color: rgb(236, 240, 241);\">1 tbsp peanut butter</span></p>\r\n<p><span style=\"color: rgb(236, 240, 241);\">There is a time or two when we want to focus on</span><br><span style=\"color: rgb(236, 240, 241);\">ast-digesting carbs. The first time is right when he</span><br><span style=\"color: rgb(236, 240, 241);\">wakes up and right after the workout. And the</span><br><span style=\"color: rgb(236, 240, 241);\">reason being right after the workout is to not only</span><br><span style=\"color: rgb(236, 240, 241);\">quickly replenish the carbs we burned during the</span><br><span style=\"color: rgb(236, 240, 241);\">workout, but also, we want them to spike insulin</span><br><span style=\"color: rgb(236, 240, 241);\">levels. The anabolic hormone insulin drives amino</span><br><span style=\"color: rgb(236, 240, 241);\">carbs (in the form of glucose) into the</span><br><span style=\"color: rgb(236, 240, 241);\">acids muscles and for</span><br><span style=\"color: rgb(236, 240, 241);\">recovery and growth, and it also turns</span><br><span style=\"color: rgb(236, 240, 241);\">on the process of muscle protein synthesis (which</span><br><span style=\"color: rgb(236, 240, 241);\">is the biochemical steps that lead to muscle</span><br><span style=\"color: rgb(236, 240, 241);\">growth).</span><br><span style=\"color: rgb(236, 240, 241);\">The other issue with carbs is timing. We should</span><br><span style=\"color: rgb(236, 240, 241);\">focus most of our carb intake on the earlier parts</span><br><span style=\"color: rgb(236, 240, 241);\">of the day, like breakfast, lunch and the snacks up</span><br><span style=\"color: rgb(236, 240, 241);\">till the afternoon. When it comes to dinner, we</span><br><span style=\"color: rgb(236, 240, 241);\">should stick with vegetables as his sides and skip</span><br><span style=\"color: rgb(236, 240, 241);\">the carby potatoes, rice, breads and pastas. Also</span><br><span style=\"color: rgb(236, 240, 241);\">will keep snacks after dinner to just protein and</span><br><span style=\"color: rgb(236, 240, 241);\">healthy fats.</span><br><span style=\"color: rgb(236, 240, 241);\">Speaking of healthy fats, we also need to get in</span><br><span style=\"color: rgb(236, 240, 241);\">ample amounts of fat, especially healthy fats like</span><br><span style=\"color: rgb(236, 240, 241);\">olive oil, egg yolks, omega-3 fats from salmon and</span><br><span style=\"color: rgb(236, 240, 241);\">other fatty fish, and peanut butter. These fats are</span><br><span style=\"color: rgb(236, 240, 241);\">not as readily stored as body fat as other fats and</span><br><span style=\"color: rgb(236, 240, 241);\">TOTALS</span><br><span style=\"color: rgb(236, 240, 241);\">2320 CALORIES, 160 G PROTEIN</span><br><span style=\"color: rgb(236, 240, 241);\">240 G CARBS, 80 G FAT</span><br><span style=\"color: rgb(236, 240, 241);\">PREWORKOUT (WITHIN 30 MINUTES</span><br><span style=\"color: rgb(236, 240, 241);\">BEFORE WORKOUTS)</span><br><span style=\"color: rgb(236, 240, 241);\">1 large apple</span><br><span style=\"color: rgb(236, 240, 241);\">REPLACE ANY OF THE WHOLE GRAINS</span><br><span style=\"color: rgb(236, 240, 241);\">(OATMEAL OR WHOLE-WHEAT BREAD)</span><br><span style=\"color: rgb(236, 240, 241);\">WITH ANY OF THESE:</span><br><span style=\"color: rgb(236, 240, 241);\">whole-wheat crackers</span><br><span style=\"color: rgb(236, 240, 241);\">brown rice</span><br><span style=\"color: rgb(236, 240, 241);\">whole-grain cold cereal</span><br><span style=\"color: rgb(236, 240, 241);\">(such as Cheerios, Quaker Oat Squares, Kashi)</span><br><span style=\"color: rgb(236, 240, 241);\">whole-wheat waffle</span><br><span style=\"color: rgb(236, 240, 241);\">Ezekiel bread</span><br><span style=\"color: rgb(236, 240, 241);\">rye bread</span><br><span style=\"color: rgb(236, 240, 241);\">sourdough bread</span><br><span style=\"color: rgb(236, 240, 241);\">whole-wheat English muffin</span><br><span style=\"color: rgb(236, 240, 241);\">whole-wheat pita bread</span><br><span style=\"color: rgb(236, 240, 241);\">whole-wheat bagel</span><br><span style=\"color: rgb(236, 240, 241);\">whole-wheat tortilla</span><br><span style=\"color: rgb(236, 240, 241);\">whole-wheat pasta</span><br><span style=\"color: rgb(236, 240, 241);\">quinoa</span><br><span style=\"color: rgb(236, 240, 241);\">sweet potato or yam</span><br><span style=\"color: rgb(236, 240, 241);\">POSTWORKOUT (WITHIN 30 MINUTES</span><br><span style=\"color: rgb(236, 240, 241);\">AFTER WORKOUTS)</span><br><span style=\"color: rgb(236, 240, 241);\">1 scoop protein powder</span><br><span style=\"color: rgb(236, 240, 241);\">BCAAs: 5 grams</span><br><span style=\"color: rgb(236, 240, 241);\">Creatine: 1.5- 5 grams</span><br><span style=\"color: rgb(236, 240, 241);\">Beta-alanine: 1.5- 3 grams</span><br><span style=\"color: rgb(236, 240, 241);\">Betaine: 1.5 - 2 grams</span><br><span style=\"color: rgb(236, 240, 241);\">carnitine: 1- 2 grams</span><br><span style=\"color: rgb(236, 240, 241);\">Glutamine: 3-5 grams</span><br><span style=\"color: rgb(236, 240, 241);\">MEAL REPLACEMENTS</span><br><span style=\"color: rgb(236, 240, 241);\">REPLACE ANY OF THE MEATS (SALMON OR</span><br><span style=\"color: rgb(236, 240, 241);\">TUNA) WITH ANY OF THESE:</span><br><span style=\"color: rgb(236, 240, 241);\">chicken breast</span><br><span style=\"color: rgb(236, 240, 241);\">chicken thighs</span><br><span style=\"color: rgb(236, 240, 241);\">turkey breast</span><br><span style=\"color: rgb(236, 240, 241);\">lean ground turkey</span><br><span style=\"color: rgb(236, 240, 241);\">lean ground beef</span><br><span style=\"color: rgb(236, 240, 241);\">tri-tip steak</span><br><span style=\"color: rgb(236, 240, 241);\">flank steak</span><br><span style=\"color: rgb(236, 240, 241);\">pork tenderloin</span><br><span style=\"color: rgb(236, 240, 241);\">bison</span><br><span style=\"color: rgb(236, 240, 241);\">salmon</span><br><span style=\"color: rgb(236, 240, 241);\">trout</span><br><span style=\"color: rgb(236, 240, 241);\">tilapia</span><br><span style=\"color: rgb(236, 240, 241);\">shrimp</span><br><span style=\"color: rgb(236, 240, 241);\">crab</span><br><span style=\"color: rgb(236, 240, 241);\">lean deli turkey breast</span><br><span style=\"color: rgb(236, 240, 241);\">lean deli roast beef</span><br><span style=\"color: rgb(236, 240, 241);\">REPLACE AN Y OF THE VEGETABLES</span><br><span style=\"color: rgb(236, 240, 241);\">(BROCCOLI OR MIXED GREEN SALAD) WITH</span><br><span style=\"color: rgb(236, 240, 241);\">ANY OF THESE:</span><br><span style=\"color: rgb(236, 240, 241);\">asparagus</span><br><span style=\"color: rgb(236, 240, 241);\">green beans</span><br><span style=\"color: rgb(236, 240, 241);\">cauliflower</span><br><span style=\"color: rgb(236, 240, 241);\">bell peppers</span><br><span style=\"color: rgb(236, 240, 241);\">Brussels sprouts</span><br><span style=\"color: rgb(236, 240, 241);\">mixed vegetables</span><br><span style=\"color: rgb(236, 240, 241);\">zucchini or other squash</span><br><span style=\"color: rgb(236, 240, 241);\">eggplant</span><br><span style=\"color: rgb(236, 240, 241);\">bok choy</span><br><span style=\"color: rgb(236, 240, 241);\">REPLACE ANY OF THE FRUIT (CANTALOUPE,</span><br><span style=\"color: rgb(236, 240, 241);\">SLICED PINEAPPLE, APPLE) WITH ANY OF</span><br><span style=\"color: rgb(236, 240, 241);\">THESE:</span><br><span style=\"color: rgb(236, 240, 241);\">orange</span><br><span style=\"color: rgb(236, 240, 241);\">peach</span><br><span style=\"color: rgb(236, 240, 241);\">banana</span><br><span style=\"color: rgb(236, 240, 241);\">pear</span><br><span style=\"color: rgb(236, 240, 241);\">strawberries</span><br><span style=\"color: rgb(236, 240, 241);\">blueberries</span><br><span style=\"color: rgb(236, 240, 241);\">raspberries</span><br><span style=\"color: rgb(236, 240, 241);\">blackberries</span><br><span style=\"color: rgb(236, 240, 241);\">cheries</span><br><span style=\"color: rgb(236, 240, 241);\">grapes</span><br><span style=\"color: rgb(236, 240, 241);\">kiwifruit</span><br><span style=\"color: rgb(236, 240, 241);\">REPLACE ANY OF THE DAIRY (COTTAGE</span><br><span style=\"color: rgb(236, 240, 241);\">CHEESE) WITH ANY OF THESE:</span><br><span style=\"color: rgb(236, 240, 241);\">Although cottage cheese is one of the best forms</span><br><span style=\"color: rgb(236, 240, 241);\">of dairy because it\'s so high in protein, you can</span><br><span style=\"color: rgb(236, 240, 241);\">also incorporate these dairy foods into the diet</span><br><span style=\"color: rgb(236, 240, 241);\">(Greek yogurt comes in a close second to cottage</span><br><span style=\"color: rgb(236, 240, 241);\">cheese):</span><br><span style=\"color: rgb(236, 240, 241);\">Greek yogurt</span><br><span style=\"color: rgb(236, 240, 241);\">Low-fat or reduced-fat cheeses</span><br><span style=\"color: rgb(236, 240, 241);\">plain low-fat yogurt</span><br><span style=\"color: rgb(236, 240, 241);\">low-fat or reduced-fat milk</span></p>', '2023-03-25 18:46:51', '2023-03-25 18:51:50'),
